import React, { useState, useEffect } from 'react';
import {
  Box,
  TextField,
  MenuItem,
  Table,
  TableBody,
  TableCell,
  TableContainer,
  TableHead,
  TableRow,
  Paper,
  Button,
  Dialog,
  DialogTitle,
  DialogContent,
  DialogActions,
  IconButton,
  Typography,
  FormControl,
  InputLabel,
  Select,
} from '@mui/material';
import CloseIcon from '@mui/icons-material/Close';
import { styled } from '@mui/material/styles';
import { Formik, Form, Field } from 'formik';
import axios from 'axios';
import InteviewPortal from './InteviewPortal';

const BootstrapDialog = styled(Dialog)(({ theme }) => ({
  '& .MuiDialogContent-root': {
    padding: theme.spacing(2),
  },
  '& .MuiDialogActions-root': {
    padding: theme.spacing(1),
  },
}));

const StyledTableCell = styled(TableCell)(({ theme }) => ({
  '&.MuiTableCell-head': {
    backgroundColor: '#1976d2',
    color: theme.palette.common.white,
  },
  '&.MuiTableCell-body': {
    fontSize: 14,
  },
}));

const StyledTableRow = styled(TableRow)(({ theme }) => ({
  '&:nth-of-type(odd)': {
    backgroundColor: theme.palette.action.hover,
  },
}));

const Token = "eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9.eyJpZCI6IjY3ODA4YTE3MzRkZGY2ZjZlZGUyNTRmMSIsImlhdCI6MTc0MzA1NTQyMn0.aZYxyCRQ1STR-TFhknYeX8hpE5jBi2jFSqTnt5RLXHU";

const QandA = () => {
  const [open, setOpen] = useState(false);
  const [ini, setIni] = useState({ questions: '',
     answer: '', subcategoryID: '' });
  const [list1, setList1] = useState([]);
  const [list2, setList2] = useState([]);

  const handleClickOpen = () => setOpen(true);
  const handleClose = () => setOpen(false);

  const handleSubmit = (values, { resetForm }) => {
    axios.post('https://interviewback-ucb4.onrender.com/questions/create', values, {
      headers: { Authorization: Token },
    })
    .then(() => {
      console.log('Data entered successfully');
      dataView();
      resetForm();
    })
    .catch(error => console.error('Error:', error));
  };

  const dataView = () => {
    axios.get('https://interviewback-ucb4.onrender.com/questions/', {
      headers: { Authorization: Token },
    })
    .then(res => setList2(res.data.data))
    .catch(error => console.error('Error fetching questions:', error));
  };

  const handleFillsubcategory = () => {
    axios.get('https://interviewback-ucb4.onrender.com/subcategory/', {
      headers: { Authorization: Token },
    })
    .then(res => setList1(res.data.data))
    .catch(error => console.error('Error fetching subcategories:', error));
  };

  useEffect(() => {
    dataView();
    handleFillsubcategory();
  }, []);

  const handleChange = (e) => {
    setIni(prev => ({ ...prev, subcategoryID: e.target.value }));
  };

  return (
    <InteviewPortal>
      <Box sx={{ width: '100%', display: 'flex' }}>
        <Box sx={{ width: '80%' }}></Box>
        <Box sx={{ width: '20%', display: 'flex', justifyContent: 'center', padding: '0px 35px' }}>
          <Button sx={{ backgroundColor: '#1976d2', color: 'white', width: '100%' }} onClick={handleClickOpen}>
            ADD Q & A
          </Button>
          <BootstrapDialog onClose={handleClose} open={open}>
            <DialogTitle>
              Add Category
              <IconButton sx={{ position: 'absolute', right: 8, top: 8 }} onClick={handleClose}>
                <CloseIcon />
              </IconButton>
            </DialogTitle>
            <Formik initialValues={ini} onSubmit={handleSubmit}>
              <Form>
                <DialogContent dividers>
                  <Field as={TextField} name='questions' label='Questions' fullWidth margin='dense' />
                  <Field as={TextField} name='answer' label='Answer' fullWidth margin='dense' />
                  <FormControl fullWidth margin='dense'>
                    <InputLabel>Subcategory Name</InputLabel>
                    <Select name='subcategoryID' value={ini.subcategoryID} onChange={handleChange}>
                      {list1.map(row => (
                        <MenuItem key={row._id} value={row._id}>{row.subCategoryname}</MenuItem>
                      ))}
                    </Select>
                  </FormControl>
                </DialogContent>
                <DialogActions>
                  <Button sx={{ backgroundColor: '#1976d2', color: 'white' }} type='submit' onClick={handleClose}>
                    Submit
                  </Button>
                </DialogActions>
              </Form>
            </Formik>
          </BootstrapDialog>
        </Box>
      </Box>
      <TableContainer component={Paper}>
        <Table sx={{ minWidth: 200, mt: '10px' }}>
          <TableHead>
            <TableRow>
              <StyledTableCell>No.</StyledTableCell>
              <StyledTableCell>Question</StyledTableCell>
              <StyledTableCell>Answer</StyledTableCell>
              <StyledTableCell>Subcategory Name</StyledTableCell>
              <StyledTableCell>Category Name</StyledTableCell>
            </TableRow>
          </TableHead>
          <TableBody>
            {list2.map((row, i) => (
              <StyledTableRow key={i}>
                <StyledTableCell>{i + 1}</StyledTableCell>
                <StyledTableCell>{row.questions}</StyledTableCell>
                <StyledTableCell>{row.answer}</StyledTableCell>
                <StyledTableCell>{row.subcategoryID?.subCategoryname}</StyledTableCell>
                <StyledTableCell>{row.subcategoryID?.categoryID?.categoryName}</StyledTableCell>
              </StyledTableRow>
            ))}
          </TableBody>
        </Table>
      </TableContainer>
    </InteviewPortal>
  );
};

export default QandA;
